import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components';
const SliderElement = styled.div`
width: 560px;
height: 150px;
margin:20px;
background-color: white;
justify-content: center;
border-radius: 5%;
box-shadow:4px 4px 8px 1px #8e8e8e;
border-radius:5px;

`
const Margin = styled.div`
max-width:810px;
margin-left:65px;
`;
export default class SuperSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3,
    };
    return (
      <Margin>
      
        <Slider {...settings}>
        <SliderElement>1
          </SliderElement>
          <SliderElement>2
          <img src="../../../public/media/icons/contract.png" alt="" />
          </SliderElement>
          <SliderElement>3
          <img src="../../../public/media/icons/contract.png" alt="" />
          </SliderElement>
          <SliderElement>4
          <img src="../../../public/media/icons/contract.png" alt="" />
          </SliderElement>
          <SliderElement>5
          <img src="../../../public/media/icons/contract.png" alt="" />
          </SliderElement>
        </Slider>
      </Margin>
    );
  }
}
